window.bookSummaryJSON = "<p>The demon of madness is dead. Daltaro is saved. And Raven suddenly found something that he had long considered lost. But there are still many secrets and unexpected meetings in his future, as well as the first event in the history of the \"game.\"</p> <p>The test that was prepared for hundreds of millions of players has begun. But are things truly as simple as they seem? The rewards are Influence Points. Once as rare as hen's teeth, they are now being given out like hotcakes. Just like the Teleportation Scrolls that lead to the Tablets. Why the sudden change? And who are these mysterious heroes?</p> <p>The stakes are higher than ever; but if he wants to get answers, he has no option but to win.</p>"; 
